import './App.css';


export default class App extends React.Component { 

  state : any = {
                  nayta : false
                }

  sanoHeippa = () : void => {

    this.setState({
                    nayta : true
                   });


  }
  render() {

    let tervehdys;

    if (this.state.nayta === true ) {

      tervehdys = <div className="alert alert-success">Heippa!</div>;

    }
  return (
    <div className="container">
      <h1>Demo 1: Hello World!</h1>

      <button className="btn btn-primary" onClick={() => { this.sanoHeippa() }}>Sano heippa!</button>

      { tervehdys }

    </div>
  )
}
}
